/* Loop Code */

let entryLen = 20
let exitLen = 10
let candle = record.current

variable.lastHighs.push(candle.max)    
variable.lastLows.push(candle.min)

if (variable.lastHighs.length > entryLen) {
    variable.lastHighs.splice(0, 1)
}
if (variable.lastLows.length > entryLen) {
    variable.lastLows.splice(0, 1)
}

variable.entryHigh = calculateHigh (variable.lastHighs, entryLen, 0)
variable.entryLow = calculateLow (variable.lastLows, entryLen, 0)
variable.exitHigh = calculateHigh(variable.lastHighs, entryLen, exitLen)
variable.exitLow = calculateLow (variable.lastLows, entryLen, exitLen)
if (variable.direction === 0) {
    variable.direction = -1
} else {
    if (variable.entryLow < variable.prevLow && variable.direction < 0) {
        variable.direction = 1
    } else {
        if (variable.entryHigh > variable.prevHigh && variable.direction > 0) {
            variable.direction = -1
        }
    }
}
variable.trend = variable.direction > 0 ? variable.entryHigh : variable.entryLow
variable.exit = variable.direction > 0 ? variable.exitHigh : variable.exitLow
variable.prevHigh = variable.entryHigh
variable.prevLow = variable.entryLow

function calculateHigh (array, length, offset) {
    if (array.length < length) { return 0 }
    if (offset === 0) {
        return Math.max(...array)
    } else {
        let arr = array.slice(offset, length)
        return Math.max(...arr)
    }
}

function calculateLow (array, length, offset) {
    if (array.length < length) { return 0 }
    if (offset === 0) {
        return Math.min(...array)
    } else {
        let arr = array.slice(offset, length)
        return Math.min(...arr)
    }
}
